import {FETCH, DELETE,CREATE,SEARCH} from '../ActionTypes/tablelist'


const initialState = {
    data : '',
    dataSearch :null
};



export const  tablelistReducer = (state = initialState, action ) => {
    switch (action.type) {
        case FETCH:
            return {
                ...state,
                data : action.payload,
                dataSearch :action.payload,
            }
        case DELETE:
            let {data} = state;

            let data2 = data.filter(item => item.key !== action.payload)

            return {
                ...state,
                data:data2
            }

        case CREATE: {
            return {
                ...state,
                data:action.payload
            }
         }
        case SEARCH: {
            let { data} = state;
            let arr3 = []
            for(let i in data){

            if(data[i].who.search(action.payload) >= 0){
                arr3.push({
                key: data[i]._id,
                createdAt: data[i].createdAt,
                desc: data[i].desc,
                publishedAt: data[i].publishedAt,
                who: data[i].who,
                type: data[i].type,
                url: data[i].url,
                used: true,
                });
            }
            return {
                ...state,
                data:arr3
            }
        }



        }
         default:
             return state;
    }
}
